Need of JWT expiresIn field to display on console<p>how to get expiry time in JWT?
I want to notice every user the expiration time of login token, right now i could display their userId, email id but unable to display expiresIn timings. Please point out where should i edit my code to display expiresIn field.</p>

<pre><code> router.post("/login", (req, res, next) =&gt; {
  User.find({ username: req.body.username })
    .exec()
    .then(user =&gt; {
      if (user.length &lt; 1) {
        return res.status(401).json({
          message: "Auth failed"
        });
      }
      bcrypt.compare(req.body.password, user[0].password, (err, result) =&gt; {
        if (err) {
          return res.status(401).json({
            message: "Auth failed"
          });
        }
        if (result) {
          const token = jwt.sign(
            {
              username: user[0].username,
              email: user[0].email,
              userId: user[0]._id,
            },
            process.env.JWT_KEY,
            {
              expiresIn: "10h"
            }
          );
          return res.status(200).json({
            message: "Auth successful",
            token: token,
            userId: user[0]._id,
            expiresIn: user[0].exp,
          });
        }
        res.status(401).json({
          message: "Auth failed"
        });
      });
    })
    .catch(err =&gt; {
      console.log(err);
      res.status(500).json({
        error: err
      });
    });
});
</code></pre>

