<p>And here's what I want to get:</p>

<blockquote>
  <p>For a specific user, I want to get an array of {workoutId, workoutDate} for the workouts that belong to that user, sorted by date.</p>
</blockquote>

<p>This is my attempt, which is working fine.</p>

<pre><code>Users.aggregate([
    { 
        $match : {
            _id : ObjectId("whateverTheUserIdIs")
        }
    }, 
    { 
        $unwind : {
            path : "$workouts"
        }
