Mongoose saves without a required field<p>I am trying to test Mongoose schemas by inserting an object which is not included with some required field.</p>

<p>This is the case:</p>

<pre><code>let schema = {
    _supplier: {
      type: Schema.Types.ObjectId,
      required: true
    },
    permissions: {
      type: [
        {
          level: {
            type: Number,
            min: 1,
            max: 9,
            required: true
          },
          title: {
            type: String,
            minlength: 0,
            maxlength: 16
          },
          modules: [String]
        }
      ],
      validate: [permissionsLimit, '${PATH} exceeds the limit of 9'],
      required: true
    }
  };

  function permissionsLimit(v) {
    return v.length&lt;=9;
  }

  let permissionsTestSchema = new Schema(schema);

  let PermissionsTest = mongoose.model("permissionsTestSchema", permissionsTestSchema);

  let permissionTest = new PermissionsTest({
    _supplier: mongoose.Types.ObjectId()
  });

  permissionTest.save(err =&gt; {
    if (err) return cast.error(err);
    return cast.ok();
  });
</code></pre>

<p>As you can see, I make an instance which only contains the <code>_supplier</code> key - I don't add the <code>permissions</code> array - <strong>Which is required</strong>.</p>

<p>Instead of receiving an error, the Mongoose applies the action and inserts a blank array of <code>permissions</code> to the collection in MongoDB.</p>

<p>This is not the behaviour I need in here.
I don't wand a document in the collection which has missing details.</p>

<p>If user do not provide with <code>permissions</code> array to his value, I do not accept the query at all.</p>

<p>Why Mongoose ignores the required field in the schema?</p>

