Convert values to keys in mongodb aggregation<p>As far as MongoDB provides <code>$group</code> approach in aggregate pipeline, it returns list of documents, where <code>_id</code> keeps some "distinct" grouping value and other field keeps array of documents,  grouped by given condition.</p>

<p>What I want is to return a single document where the properties are the results of the aggregation.</p>

<p>Example collection: </p>

<pre><code>{author: "Author1", title: "Title1"}
{author: "Author2", title: "Title2"}
{author: "Author2", title: "Title3"}
</code></pre>

<p>The aggregation</p>

<pre><code>db.getCollection('books').aggregate([ 
    {"$group": {
           _id: "$author",
           books: { $push: "$$ROOT" }
          }
    }
])
</code></pre>

<p>This gives me the following output:</p>

<pre><code>{_id: 'Author1', books: [{author: "Author1", title: "Title1"}]},
{_id: 'Author2', books: [{author: "Author2", title: "Title2"}, {author: "Author2", title: "Title3"}]}
</code></pre>

<p>But i would like to get the results as one single object like this:</p>

<pre><code>{
  Author1: [
    {author: "Author1", title: "Title1"}
  ],
  Author2: [ 
    {author: "Author2", title: "Title2"},
    {author: "Author2", title: "Title3"}
  ]
}
</code></pre>

<p>In simple words, i want to use <code>_id</code> property as new field in resulting document, and proper <code>$group</code> values for specific <code>_id</code> must be value of new variable.</p>

<p>If somebody faced with such a queries, please, assist with that or give some clues how to solve it. Thanks in advance.</p>

